define({"topics":[{"title":"Collages","shortdesc":"<p class=\"shortdesc\">Works in two dimensions or very low relief that were made by gluing paper, fabrics, photographs, or other materials onto a flat surface.<\/p>","href":"concepts\/supertypes\/collages.html","attributes":{"data-id":"supertype_Collages"},"menu":{"hasChildren":false},"tocID":"supertype_Collages-d2032e1012","topics":[]},{"title":"Image Data","shortdesc":"<p class=\"shortdesc\"\/>","href":"concepts\/supertypes\/imagedata_2.html","attributes":{"data-id":"supertype_ImageData"},"menu":{"hasChildren":false},"tocID":"supertype_ImageData-d2032e1055","topics":[]},{"title":"Drawings","shortdesc":"<p class=\"shortdesc\">Visual works produced by drawing, typically by the application of lines on a surface, often paper, by using a pencil, pen, chalk, or some other tracing instrument to focus on the delineation of form rather than the application of color.<\/p>","href":"concepts\/supertypes\/drawings.html","attributes":{"data-id":"supertype_Drawings"},"menu":{"hasChildren":false},"tocID":"supertype_Drawings-d2032e1097","topics":[]},{"title":"Maps","shortdesc":"<p class=\"shortdesc\">Refers to graphic or photogrammetric representations of the Earth's surface or a part of it, including physical features and political boundaries, where each point corresponds to a geographical or celestial position according to a definite scale or projection. The term may also refer to similar depictions of other planets, suns, other heavenly bodies, or areas of the heavens. Maps are typically depicted on a flat medium, such as on paper, a wall, or a computer screen. <\/p>","href":"concepts\/supertypes\/maps_2.html","attributes":{"data-id":"supertype_Maps"},"menu":{"hasChildren":false},"tocID":"supertype_Maps-d2032e1140","topics":[]},{"title":"Paintings","shortdesc":"<p class=\"shortdesc\">Unique works in which images are formed primarily by the direct application of pigments suspended in oil, water, egg yolk, molten wax, or other liquid, arranged in masses of color, onto a generally two-dimensional surface.<\/p>","href":"concepts\/supertypes\/paintings.html","attributes":{"data-id":"supertype_Paintings"},"menu":{"hasChildren":false},"tocID":"supertype_Paintings-d2032e1183","topics":[]},{"title":"Photographs","shortdesc":"<p class=\"shortdesc\">Refers to still images produced from radiation-sensitive materials generally by means of the chemical action of light on a sensitive film, paper, glass, or metal.<\/p>","href":"concepts\/supertypes\/photographs.html","attributes":{"data-id":"supertype_Photographs"},"menu":{"hasChildren":false},"tocID":"supertype_Photographs-d2032e1226","topics":[]},{"title":"Pictures","shortdesc":"<p class=\"shortdesc\">Catch-all category for resources that contain some kind of pictorial content, but a more specific kind cannot be determined from the mapping.<\/p>","href":"concepts\/supertypes\/pictures.html","attributes":{"data-id":"supertype_Pictures"},"menu":{"hasChildren":false},"tocID":"supertype_Pictures-d2032e1269","topics":[]},{"title":"Posters","shortdesc":"<p class=\"shortdesc\">Notices, usually decorative or pictorial, intended to be posted to advertise, promote, or publicize an activity, cause, product, or service; also, decorative, mass-produced prints intended for hanging. For small printed notices or advertisements intended for distribution by hand, use \"handbills.\"<\/p>","href":"concepts\/supertypes\/posters.html","attributes":{"data-id":"supertype_Posters"},"menu":{"hasChildren":false},"tocID":"supertype_Posters-d2032e1312","topics":[]},{"title":"Prints","shortdesc":"<p class=\"shortdesc\">Pictorial works produced by transferring images by means of a matrix such as a plate, block, or screen, using any of various printing processes.<\/p>","href":"concepts\/supertypes\/prints.html","attributes":{"data-id":"supertype_Prints"},"menu":{"hasChildren":false},"tocID":"supertype_Prints-d2032e1355","topics":[]},{"title":"Slides","shortdesc":"<p class=\"shortdesc\">An image on film or glass, usually positive, intended to be viewed by means of light passing through the image.<\/p>","href":"concepts\/supertypes\/slides.html","attributes":{"data-id":"supertype_Slides"},"menu":{"hasChildren":false},"tocID":"supertype_Slides-d2032e1398","topics":[]}]});